import React, { useState } from 'react';
import { Button, Container, Form } from 'react-bootstrap';

const Login = () => {
    const [name, setName] = useState();
    const [pass,setPass] = useState();
    const changeName = (e) => {
        setName(e.target.value)
    }
    const changePass = (e) => {
        setPass(e.target.value)
    }
    const handleSubmit = () => {
        if(name.length === 0){
            alert("Khong duoc bo trong")
        }
        else if(pass.length < 8){
            alert("Mat khau it nhat 8 ky tu")
        }
    }
    return (
        <Container>
            <Form>
                <Form.Group>
                    <Form.Label>UserName</Form.Label>
                    <Form.Control type='text' onChange={changeName}></Form.Control>
                </Form.Group>
                <Form.Group>
                    <Form.Label>Password</Form.Label>
                    <Form.Control type='password' onChange={changePass}></Form.Control>
                </Form.Group>
                <Form.Group>
                    <Form.Label></Form.Label>
                    <Form.Control type = 'button' onClick={handleSubmit} value='Login' />
                </Form.Group>
                <Form.Group>
                    <Form.Label></Form.Label>
                    <Form.Control type = 'button' onClick={handleSubmit} value='Register' />
                </Form.Group>
            </Form>
        </Container>
    );
};

export default Login;
